import './App.css';
import LOGO from "./assets/logo.png"
/**
 * Header
 *  -Logo
 *  -nav-bar
 * Body
 *  -search
 *  -filter
 *  -sort
 *  -restraurants cards
 *      -
 * Footer
 *  -links
 */

const Header = ()=>{
  return(
    <div className="header">
      <div className="log-cotainer">
        <img className="logo" src={LOGO}/>
      </div>
      <div className="nav-items">
          <ul>
            <li>Home</li>
            <li>About us</li>
            <li>Contact Us</li>
            <li>Cart</li>
          </ul>
      </div>
    </div>
  )
}

const Body = ()=>{
  return(
    <div className="body">
      <div className="search">Search</div>
      <div className="res-container">
          <RestraurantCard resName="Homely Bites" cuisine="Pizza ,Itelian, Indian"/>
          <RestraurantCard resName="KFC" cuisine="Burger, Fast Food"/>
      </div>
    </div>
  )
}

const RestraurantCard = ()=>{
  return(
    <div className="res-card">
      <img className="res-img" alt="food-img" src="https://th.bing.com/th?id=OIP.cFk7icN483HJD3wFnXXyawHaEo&w=316&h=197&c=8&rs=1&qlt=90&o=6&dpr=1.3&pid=3.1&rm=2"/>
      <h3>Homely Bites</h3>
      <span>Pizza ,Itelian, Indian</span>
      <div className="card-div">
        <div>4.3</div>
        <div>27 MIN</div>
        <div>400/-</div>
      </div>
    </div>
  )
}

function App() {
  return (
    <div className="App">
      <Header/>
      <Body/>
    </div>
  );
}

export default App;
